import React from 'react';
import { contacts } from '../data';
import { EnvelopeIcon } from '@heroicons/react/24/solid';

export default function Contact() {
    return(
        <section id='contact'>
            <div className='container px-5 py-10 mx-auto text-center'>
                <h1 className='sm:text-4xl text-3xl font-medium title-font text-white mb-12'>
                   How to reach me
                </h1>
                <div className='flex flex-wrap m-4 justify-center'>
                    {contacts.map((contact) => (
                        <div className='p-4 md:w-1/2 w-full'>
                            <div className='h-full bg-gray-800 bg-opacity-40 p-8 rounded'>
                                <span className='title-font text-center font-medium text-white flex flex-wrap'>
                                    Email: {contact.email}
                                </span>
                                <br></br>
                                <br></br>
                                <span className='title-font font-medium text-white text-center flex'>
                                    Phone: {contact.phoneNumber}
                                </span>
                                <br></br>
                                <br></br>
                                <a className='hover:text-blue-400 title-font font-medium text-white'href={contact.LinkedIN} target="_blank" rel="noreferrer">LinkedIn</a>
                                <br></br>
                                <br></br>
                                <a className='hover:text-blue-400 title-font font-medium text-white'href={contact.Github} target="_blank" rel="noreferrer">Github</a>


                            </div>
                        </div>

                    ))}
                </div>

            </div>
        </section>
    )

}
